import React from 'react'

const Anima = ({color}) => {
    let colorValue =color ? color :'black';
    return (
        <div className = 'anima col-12 px-0'>            
            <div className="sanjiaoxing first">
                   
            </div>
            <div className="sanjiaoxing last">
                   
            </div> 
            <div className="sanjiaoxing first">
                   
                   </div>
                   <div className="sanjiaoxing last">
                          
            </div> 
            <div className="sanjiaoxing first">                   
                   </div>
                   <div className="sanjiaoxing last">
                          
                   </div>                         
            <style>{`
                .anima {
                    display:flex;
                    justify-content:center;
                }
                .sanjiaoxing {
                    display:inline-block;
                    width:0;
                    height:0;
                    border:solid 20px rgba(0,0,0,0);   
                    border-bottom:solid 20px ${colorValue};                              
                }
                .first {
                    transform-origin:100% 100%;
                    animation:go 2s infinite;                         
                }
                .last {
                    transform-origin:0% 100%;
                    animation:go2 2s infinite;          
                }
                @keyframes go {
                    0% {
                        transform: rotate(0deg) translateX(0);                   
                    }
                    15% {                          
                        transform: rotate(90deg) translateX(0);                                                
                    }
                    45% {
                        transform: rotate(90deg) translateY(0);                         
                    }
                    55% {
                        transform: rotate(90deg) translateY(50%);                        
                    }
                    85% {
                        transform: rotate(90deg) translateY(50%);                        
                    }
                    100% {
                        transform: rotate(0deg) translateY(0%);  
                    }
                }
                @keyframes go2 {
                    0% {
                        transform: rotate(0deg) translateX(0);  
                    }
                    15% {                          
                        transform: rotate(-90deg) translateX(0);                          
                    }
                    45% {
                        transform: rotate(-90deg) translateX(0);                          
                    }
                    55% {
                        transform: rotate(-90deg) translateY(50%);  
                    }
                    85% {
                        transform: rotate(-90deg) translateY(50%);  
                    }                    
                    100% {
                        transform: rotate(0deg) translateY(0%);  
                    }
                }
            `}</style>
        </div>
    )
}

export default Anima
